import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import { motion } from "framer-motion";
import { ArrowLeft, Clock, Info } from "lucide-react";
import "./History.css";

interface Pokemon {
  id: number;
  name: string;
  imageUrl: string;
  description: string;
  type: string;
  height: string;
  weight: string;
  abilities: string[];
  evolution: string;
  history: string;
}

const History = () => {
  const { id } = useParams<{ id: string }>();
  const [pokemon, setPokemon] = useState<Pokemon | null>(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchPokemonData = async () => {
      // In a real application, you would fetch this data from an API
      // For this example, we'll use the data provided in the prompt
      const mockData: Pokemon = {
        id: 1,
        name: "Iron Bundle",
        imageUrl: "/img/iron-bundle.png",
        description:
          "Iron Bundle is a futuristic Pokémon with powerful Ice and Water abilities.",
        type: "Ice/Water",
        height: "1.5 m",
        weight: "85 kg",
        abilities: ["Quark Drive"],
        evolution: "N/A",
        history:
          "Iron Bundle emerged as a groundbreaking discovery in the Paldea region, representing a unique fusion of technological innovation and biological evolution. Developed by the Pokémon Research Team at the Naranja/Uva Academy, this Pokémon is part of the enigmatic Iron Hands series, a group of artificial or technologically enhanced creatures that blur the lines between natural Pokémon and advanced robotics. Its origins can be traced back to experimental research exploring the integration of quantum-like energetic properties with traditional Pokémon physiology. The creature's distinctive Quark Drive ability suggests a deep connection to cutting-edge scientific understanding, allowing it to adapt and generate extraordinary energy patterns that defy conventional Pokémon capabilities. Unlike traditional Ice and Water-type Pokémon, Iron Bundle represents a new frontier of Pokémon development, embodying the potential for artificial intelligence and biological engineering to create entirely new forms of life. Researchers are particularly fascinated by its unique morphology, which combines sleek, mechanical elements with organic characteristics, making it a subject of intense study in the fields of Pokémon biology, quantum mechanics, and artificial intelligence. Its discovery has sparked widespread debate about the nature of Pokémon existence and the ethical implications of creating such technologically advanced living beings.",
      };

      setPokemon(mockData);
      setLoading(false);
    };

    fetchPokemonData();
  }, [id]);

  if (loading) {
    return (
      <div className="loading-container">
        <div className="loading-spinner"></div>
      </div>
    );
  }

  if (!pokemon) {
    return <div className="pokemon-not-found">Pokémon not found</div>;
  }

  return (
    <div className="history-container">
      <Link to="/" className="back-link">
        <ArrowLeft className="back-icon" />
        Back to Pokédex
      </Link>
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="pokemon-card"
      >
        <div className="pokemon-header">
          <div className="pokemon-image-container">
            <img
              className="pokemon-image"
              src={pokemon.imageUrl}
              alt={pokemon.name}
            />
          </div>
          <div className="pokemon-info">
            <div className="pokemon-type">{pokemon.type}</div>
            <h1 className="pokemon-name">{pokemon.name}</h1>
            <p className="pokemon-description">{pokemon.description}</p>
          </div>
        </div>
        <div className="history-section">
          <h2 className="section-title">
            <Clock className="section-icon" />
            Historical Background
          </h2>
          <motion.p
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.3, duration: 0.5 }}
            className="history-text"
          >
            {pokemon.history}
          </motion.p>
        </div>
        <div className="additional-info-section">
          <h3 className="section-title">
            <Info className="section-icon" />
            Additional Information
          </h3>
          <ul className="info-list">
            <li className="info-item">
              <span className="info-label">Height:</span> {pokemon.height}
            </li>
            <li className="info-item">
              <span className="info-label">Weight:</span> {pokemon.weight}
            </li>
            <li className="info-item">
              <span className="info-label">Abilities:</span>{" "}
              {pokemon.abilities.join(", ")}
            </li>
            <li className="info-item">
              <span className="info-label">Evolution:</span> {pokemon.evolution}
            </li>
          </ul>
        </div>
      </motion.div>
    </div>
  );
};

export default History;
